import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { ArrowLeft, Sun, Moon } from 'lucide-react'; 

const ThemeSelection = ({ currentTheme, setTheme }) => {
  const navigate = useNavigate();
  const [tempTheme, setTempTheme] = useState(currentTheme);
  const [showToast, setShowToast] = useState(false);

  const handleApply = () => {
    setTheme(tempTheme); // Updates global state in App.js
    setShowToast(true);
    setTimeout(() => setShowToast(false), 2000);
  };

  return (
    <div style={{ 
      padding: '16px', 
      backgroundColor: tempTheme === 'dark' ? '#0f172a' : '#f8fafc', 
      minHeight: '100vh',
      color: tempTheme === 'dark' ? '#fff' : '#1e293b'
    }}>
      <header style={{ display: 'flex', alignItems: 'center', marginBottom: '24px' }}>
        <ArrowLeft size={24} onClick={() => navigate(-1)} style={{ cursor: 'pointer' }} />
        <h2 style={{ marginLeft: '16px', fontSize: '18px', fontWeight: 'bold' }}>App Theme</h2>
      </header>

      {/* Theme Options Card */}
      <div style={{ 
        backgroundColor: tempTheme === 'dark' ? '#1e293b' : '#fff', 
        borderRadius: '16px', 
        border: tempTheme === 'dark' ? '1px solid #334155' : '1px solid #e2e8f0' 
      }}>
        <div onClick={() => setTempTheme('light')} style={optionStyle}>
          <Sun size={20} color="#5c5cfc" />
          <div style={{ flex: 1, marginLeft: '12px' }}>
            <div style={{ fontWeight: 'bold', fontSize: '14px' }}>Light Mode</div>
            <div style={{ fontSize: '12px', color: '#94a3b8' }}>Bright background</div>
          </div>
          <RadioButton active={tempTheme === 'light'} />
        </div>
        <div onClick={() => setTempTheme('dark')} style={optionStyle}>
          <Moon size={20} color="#5c5cfc" />
          <div style={{ flex: 1, marginLeft: '12px' }}>
            <div style={{ fontWeight: 'bold', fontSize: '14px' }}>Dark Mode</div>
            <div style={{ fontSize: '12px', color: '#94a3b8' }}>Dark background</div>
          </div>
          <RadioButton active={tempTheme === 'dark'} />
        </div>
      </div>

      <button onClick={handleApply} style={applyBtnStyle}>
        Apply Theme
      </button>

      {/* Success Toast */}
      {showToast && (
        <div style={toastStyle}>
          <div style={{ backgroundColor: '#dcfce7', color: '#166534', padding: '8px 24px', borderRadius: '20px' }}>
            âœ“ Theme updated
          </div>
        </div>
      )}
    </div>
  );
};

// Internal Helper Styles
const optionStyle = { display: 'flex', alignItems: 'center', padding: '16px', cursor: 'pointer' };
const applyBtnStyle = { width: '100%', backgroundColor: '#5c5cfc', color: '#fff', border: 'none', padding: '16px', borderRadius: '12px', fontWeight: 'bold', marginTop: '40px', cursor: 'pointer' };
const toastStyle = { position: 'fixed', bottom: '100px', left: '50%', transform: 'translateX(-50%)' };
const RadioButton = ({ active }) => (
  <div style={{ width: '20px', height: '20px', borderRadius: '50%', border: '2px solid #5c5cfc', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
    {active && <div style={{ width: '10px', height: '10px', backgroundColor: '#5c5cfc', borderRadius: '50%' }} />}
  </div>
);

export default ThemeSelection;
